import { Formik, Form, Field } from 'formik';

export default function AddMovie() {
  return (
    <div>
      add movie
      <Formik initialValues={accountFormInitialValues} onSubmit={async (values,{setSubmitting}) => {
                    setSubmitting(true);
                    checkIfSubmittedDetailsAreSame();
                    if(!areSubmittedDetailsSameRef.current) {
                      await mutateUpdateUser({variables: values});
                      closeModal();
                    }
                    setSubmitting(false);
                }}>
        <Form className='movies-form-account'>
          <Field name='email' type="text"></Field>
          <Field name='name' type="text"></Field>
          <button type="submit">add</button>
        </Form>
      </Formik>
    </div>
  )
}
